import React, { createContext, useState, useEffect } from 'react';
// ✅ Cognito servis fonksiyonların
import { loginUser, signupUser, logoutUser, getCurrentUserProfile, } from '@/auth/authService';
/**
 * Authentication context
 */
export const AuthContext = createContext(undefined);
export function AuthProvider({ children }) {
    const [user, setUser] = useState(null);
    const [isLoading, setIsLoading] = useState(true);
    // ✅ Sayfa yenilenince Cognito session var mı kontrol et
    useEffect(() => {
        const checkAuth = async () => {
            try {
                const profile = await getCurrentUserProfile();
                setUser(profile);
            }
            catch {
                setUser(null);
            }
            finally {
                setIsLoading(false);
            }
        };
        checkAuth();
    }, []);
    // ✅ Login = Cognito authenticate
    const login = async (email, password) => {
        setIsLoading(true);
        try {
            await loginUser(email, password);
            // login sonrası user bilgisi al
            const profile = await getCurrentUserProfile();
            setUser(profile);
        }
        catch (error) {
            console.error('Login error:', error);
            throw error;
        }
        finally {
            setIsLoading(false);
        }
    };
    // ✅ Logout = Cognito signOut
    const logout = async () => {
        setIsLoading(true);
        try {
            await logoutUser();
            setUser(null);
        }
        catch (error) {
            console.error('Logout error:', error);
            throw error;
        }
        finally {
            setIsLoading(false);
        }
    };
    // ✅ Signup = Cognito signUp
    const signup = async (email, password, name) => {
        setIsLoading(true);
        try {
            await signupUser(email, password, name);
            // NOT: Cognito email verification istiyorsa,
            // burada otomatik login yapmayabilir.
            // İstersen signup sonrası Login sayfasına yönlendirirsin.
        }
        catch (error) {
            console.error('Signup error:', error);
            throw error;
        }
        finally {
            setIsLoading(false);
        }
    };
    const value = {
        user,
        isAuthenticated: !!user,
        isLoading,
        login,
        logout,
        signup,
    };
    return <AuthContext.Provider value={value}>{children}</AuthContext.Provider>;
}
